  02> GREEN, Caroline Eila
  b 06.10.1975
  Caroline b, at Canterbury, Kent.
  02> ELLIOTT, Nigel Kennedy
  b 02.03.1947 d **.03.1975
  Nigel b. at Wellington, d. in Vic, Australia (motor cycle accident) and cremated at Wellington.
  lo>'WILLIAMS, Algar Temple m on 15.10.1907 to (1) BOYLE, Janet
  b 03.10.1877 d 07.08.1966
  b 22.01.1886 d 16.03.1974
  Algar b. at Wellington and m, at St Michael and All Angels' Church, Christchurch, Janet b, at Otaio, South
  Canterbury.
  Algar was educated at Wanganui Collegiate School (1889-95, prefect, rower). He farmed in the Wairarapa then was
  a tea planter in Ceylon for some years. During WW1 he served overseas as a Lieutenant with the New Zealand
  Field Artillery and was ADC to General Sir Andrew Russell. After the war he was a stockbroker in Wellington for
  some years before retiring to Christchurch. He designed and built a beautiful garden at Fernside near
  Featherston, where he was business adviser to the owner, Mrs Elgar.
  Early research on the life of Henry Williams had been undertaken by Hilda Temple Williams with the help of her
  cousin, Henry (Hal) Williams. After Hilda's death in 1939 Algar took over the research and copied by hand many
  hundreds of Henry Williams' letters. Both originals and copies are now deposited in the Auckland Museum. These
  early records were the source of "Journals of Henry Williams", 1961 and "The Life of Henry Williams", 1972 both
  written by Lawrence Rogers of Tauranga.
  01> WILLIAMS, Juliet
  b 17.09.1908 d 18.04.1919
  Juliet b. at Wellington and bd. at St Peter's, Upper Riccarton, Christchurch.
  02> WILLIAMS, David Temple
  6 25.02.1912
  David b, at Wellington. Address: Edith Cavell, Head Street, Sumner, Christchurch.
  He attended Waihi School, Winchester and Christ's College. He worked for several years with the NZ Aerial
  Mapping Co in Hastings and served in the Army in New Zealand in WW2.
  03> WILLIAMS, Belinda Temple m on 17.09.1960 to FITZGERALD, Gerald
  b 18.04.1928
  b 12.02.1926
  Belinda b. at Christchurch and m. at St Peter's Church, Upper Riccarton, Christchurch. Gerald, s/o Dr GP
  Fitzgerald (Dunedin) and Constance Beaumont, b. at Dunedin. Address: 8 Searidge Lane, Scarborough,
  Christchurch.
  Belinda was a Karitane nurse.
  Gerald read Theology at Oxford (MA Oxon) and Westcott House, Cambridge and was ordained in Manchester in
  1954 before returning to New Zealand. He read Law at Canterbury University (LLB) and practiced as a
  solicitor in Christchurch until retiring in 1988.
  01> FITZGERALD, Edward Temple Guy m on 25.07.1992 to MCCLELLAND, Lisa Jane
  b 19.08.1961
  b 11.11.1966
  Edward b. at Christchurch. Lisa, d/o Duncan and Della McClelland of Picton. Address: 27 Taylor Pass
  Road, Blenheim. Email: elfitz@voyager.co, nz.
  Edward was educated at Cathedral Grammar School; Waihi School, Winchester and Christ's College. He
  trained for two years at Roseworthy College near Adelaide as a wine marketer. He worked as a wine
  consultant for Negociants New Zealand (1992-96) and for Rapaura Vintners Renwick (1996) and is now a
  winery consultant with Daniel Le Brun and the Le Brun Family Estate.
  Lisa graduated BA in Education and Psychology in 1994.
